import React from 'react'
import footerbg from '../../assets/images/footerbg.jpeg'
import logo from '../../assets/images/sankalptaru-new-logo-white.png'
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { styled } from '@mui/material/styles';

const Item = styled(Paper)(({ theme }) => ({
  color: "white",
}));

const Footer = () => {
  const footer1 = [{name:'How it works'},{name: 'Blogs'}, {name:'Imapct'}];
  const footer2 = [{name:'Mission'},{name: 'Gallery'}, {name:'Our team'},{name:'Our achievements'}];
  const footer3 = [{name:'Careers'},{name: 'Contact us'}, {name:'Volunteer with us'},, {name:'Terms & Conditions'},, {name:'Register as farmer beneficiary'}];
  const footer4 = [{name:'How it works'},{name: 'Blogs'}, {name:'Imapct'}];

  return (
    <div style={{ backgroundImage:`url(${footerbg})`, 
    opacity:0.7,
    height:"100vh",
    width:"100%",
    backgrounPosition: "center",
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    justifyContent:"center"}}>
      <Grid container spacing={3} className='choice' >
        <Grid xs={4}>
          <div>
            <img src={logo} style={{height:"100px", padding:"50px"}}></img>
          </div>
        </Grid>
        <Grid xs={2}>
          <div>
            <h3>Company</h3>
            <ul style={{listStyle:"none"}}>
            {footer1.map(list => {
                return (
                  <li>{list.name}</li>)})}
            </ul>
            </div>
        </Grid>
        <Grid xs={2}>
        <div>
            <h3>Company</h3>
            <ul style={{listStyle:"none"}}>
            {footer2.map(list => {
                return (
                  <li>{list.name}</li>)})}
            </ul>
            </div>
        </Grid>
        <Grid xs={2}>
        <div>
            <h3>Company</h3>
            <ul style={{listStyle:"none"}}>
            {footer3.map(list => {
                return (
                  <li>{list.name}</li>)})}
            </ul>
            </div>
        </Grid>
        <Grid xs={2}>
        <div>
            <h3>Company</h3>
            <ul style={{listStyle:"none"}}>
            {footer4.map(list => {
                return (
                  <li>{list.name}</li>)})}
            </ul>
            </div>
        </Grid>
      </Grid>



    </div>
  )
}

export default Footer
